'''

-Hard-
*DP*
*Memoization*
*DFS*


Alice has an undirected tree with n nodes labeled from 0 to n - 1. The tree is represented as a 2D integer array edges of length n - 1 where edges[i] = [ai, bi] indicates that there is an edge between nodes ai and bi in the tree.

Alice wants Bob to find the root of the tree. She allows Bob to make several guesses about her tree. In one guess, he does the following:

Chooses two distinct integers u and v such that there exists an edge [u, v] in the tree.
He tells Alice that u is the parent of v in the tree.
Bob's guesses are represented by a 2D integer array guesses where guesses[j] = [uj, vj] indicates Bob guessed uj to be the parent of vj.

Alice being lazy, does not reply to each of Bob's guesses, but just says that at least k of his guesses are true.

Given the 2D integer arrays edges, guesses and the integer k, return the number of possible nodes that can be the root of Alice's tree. If there is no such tree, return 0.

 

Example 1:



Input: edges = [[0,1],[1,2],[1,3],[4,2]], guesses = [[1,3],[0,1],[1,0],[2,4]], k = 3
Output: 3
Explanation: 
Root = 0, correct guesses = [1,3], [0,1], [2,4]
Root = 1, correct guesses = [1,3], [1,0], [2,4]
Root = 2, correct guesses = [1,3], [1,0], [2,4]
Root = 3, correct guesses = [1,0], [2,4]
Root = 4, correct guesses = [1,3], [1,0]
Considering 0, 1, or 2 as root node leads to 3 correct guesses.

Example 2:



Input: edges = [[0,1],[1,2],[2,3],[3,4]], guesses = [[1,0],[3,4],[2,1],[3,2]], k = 1
Output: 5
Explanation: 
Root = 0, correct guesses = [3,4]
Root = 1, correct guesses = [1,0], [3,4]
Root = 2, correct guesses = [1,0], [2,1], [3,4]
Root = 3, correct guesses = [1,0], [2,1], [3,2], [3,4]
Root = 4, correct guesses = [1,0], [2,1], [3,2]
Considering any node as root will give at least 1 correct guess. 

 

Constraints:

edges.length == n - 1
2 <= n <= 105
1 <= guesses.length <= 105
0 <= ai, bi, uj, vj <= n - 1
ai != bi
uj != vj
edges represents a valid tree.
guesses[j] is an edge of the tree.
guesses is unique.
0 <= k <= guesses.length


'''


from typing import List
from collections import defaultdict
from functools import lru_cache

class Solution:
    def rootCount(self, edges: List[List[int]], guesses: List[List[int]], k: int) -> int:
        # TLE
        n = len(edges) + 1
        G = [[] for _ in range(n)]
        for u,v in edges:
            G[u].append(v)
            G[v].append(u)
        ans = 0
        gu = set((u,v) for u,v in guesses)           
        for i in range(n):
            visited = [False]*n            
            ret = 0
            def dfs(u):
                nonlocal ret
                visited[u] = True
                for v in G[u]:
                    if not visited[v]:
                        if (u,v) in gu:
                            ret += 1
                        dfs(v)
            dfs(i)
            # print(i, ret)
            if ret >= k:
                ans += 1
        return ans 
    
    def rootCount2(self, edges: List[List[int]], guesses: List[List[int]], k: int) -> int:
        # Reroot
        n = len(edges) + 1
        G = [[] for _ in range(n)]
        gu = defaultdict(set)
        for u,v in edges:
            G[u].append(v)
            G[v].append(u)
        ans = 0
        for u,v in guesses:
            gu[u].add(v)
        parents = [-1]*n
        def dfs(u, par):
            parents[u] = par    
            for v in G[u]:
                if v != par:                   
                    dfs(v, u)
        dfs(0, -1)    
        correct = 0
        for i in range(1, n):
            p = parents[i]
            if i in gu[p]: correct += 1
        if correct >= k: ans += 1

        def dfs1(u, par, corr):
            nonlocal ans
            cur = corr
            if u in gu[par]: cur -= 1
            if par in gu[u]: cur += 1
            if cur >= k: ans += 1   
            for v in G[u]:
                if v != par:
                    dfs1(v, u, cur)
        for v in G[0]:
            dfs1(v, 0, correct)
        return ans 
    
    def rootCount3(self, edges: List[List[int]], guesses: List[List[int]], k: int) -> int:
        # n memory
        # build graph
        graph = defaultdict(list)
        for i, j in edges:
            graph[i].append(j)
            graph[j].append(i)
        
        gt = set((i, j) for i, j in guesses)

        # dfs traverse from parent -> i
        @lru_cache(None)
        def get_correct_pairs(i, parent):
            next_nodes = graph[i]
            n_correct = 0
            for next_node in next_nodes:
                if next_node == parent:
                    continue
                if (i, next_node) in gt:
                    n_correct += 1
                n_correct += get_correct_pairs(next_node, i)
            return n_correct
        
        ans = 0
        for i in graph:
            if get_correct_pairs(i, -1) >= k:
                ans += 1
        return ans


